import './App.scss'


export default function App(){ 
    let name = 'world'
    let arr = ['Berlin', 'hamburg', 'Frankfurt']
    let allCities = arr.map(city=><li>{city}</li>)
        return (
            <React.Fragment>

            <h1 style={{'text-align':'center'}}>Hello  {name} </h1>
            <h2>City Names</h2>
            <ul>
                {allCities}
            </ul>
            </React.Fragment>
        )
    }
